WORKER (n=9) (
Fig. 34A–C
): HL 1.20 (1.10–1.28); HW 1.15 (1.10–1.28); ML 0.78 (0.74–0.88); SL 0.84 (0.82–0.98); MOD 0.28 (0.24–0.30); PNW 0.80 (0.77–0.90); WL 1.56 (1.51–1.75); PSL 0.44 (0.36–0.58); PL 0.73 (0.68–0.82); PW 0.28 (0.27–0.30); PPL 0.36 (0.36–0.45); PPW 0.38 (0.36–0.42); GL 1.34 (1.24–1.44); TL 5.97 (5.67–6.47); CI 95.83 (95.76–101.61); SI 73.04 (70.50–79.64); OI 24.34 (21.81–24.77). Large-sized. Subopaque integument, except for the shiny gaster. Dark brown head and mesosoma, other body parts lighter. Many thin and unbranched setae (
Fig. 80B
), long to midsized, erect to subdecumbent.

QUEEN (n=7) (
Fig. 35A–C
): HL 1.13 (1.13–1.36); HW 1.06 (1.06–1.36); ML 0.73 (0.73–0.92); SL 0.82 (0.82–1); MOD 0.29 (0.28–0.36); PNW 0.90 (0.90–1.08); WL 1.62 (1.62–2.08); PSL 0.40 (0.39–0.50); PL 0.71 (0.71–0.94); PW 0.28 (0.28–0.35); PPL 0.42 (0.42–0.52); PPW 0.39 (0.39–0.51); GL 1.46 (1.46–1.74); TL 6.07 (6.07–7.54); CI 93.80 (93.80–101.50); SI 77.35 (69.23–73.77); OI 27.35 (23.73–27.05). Large-sized. Color, pilosity, and some sculpture characters shared with conspecific workers, only slightly larger. Larger diameter of eye with 14–15 ommatidia. Vermicular striae on scutum going from an anterior central point towards transcutal suture, interspaces indistinguishable. Longitudinal striae of uniform thickness on anepisternum and katepisternum, mostly regular, interspaces indistinguishable. Axilla and scutellum with same sculpture of scutum. Scutoscutellar sulcus conspicuous. Transverse striae on propodeum (DV). Lateral surface of mesosoma with vermicular striae directed in part to propodeal dorsum and in part to propodeal spine, interspaces indistinguishable. Wings unknown.
